select * from transactions
---What is the total number of transactions?---
select count(*) from transactions
----What is the total number of customers?---
select count(*) from customers
----What are the first 5 transactions?---
select top (5) * from transactions
---What is the total number of transactions that took place in Chennai?---
select count(*) from transactions
where market_code='Mark001'
----Transactions took place in Chennai?---
select * from transactions
where market_code='Mark001'
---Show all the International Transactions?---
select * from transactions
where currency = 'USD'
select * from date
---Show the transactions that took place in year 2020?---
select transactions.*,date.* from transactions
inner join date
on
transactions.order_date=date.date
where date.year=2020
---What is the total number of goods that are sold in year 2020?---
select sum(transactions.sales_qty) as 'total sales' from transactions
inner join date
on
transactions.order_date=date.date
where date.year =2020
---What is the total sales revenue in year 2019?---
select sum(transactions.sales_amount) as 'total sales amount' from transactions
inner join date
on
transactions.order_date=date.date
where date.year=2019
select * from markets
select * from transactions
---What is the sales revenue earned from Chennai?---
select sum(sales_amount) as 'sales in Chennai' from transactions
where market_code='Mark001'
---What is the total sales revenue earned from Chennai in year 2017?---
select sum(transactions.sales_amount) as 'Sales in Chennai' from transactions 
inner join date
on 
transactions.order_date = date.date
where transactions.market_Code='Mark001' and date.year=2017
---What are the different products that are sold in Chennai?---
select distinct(transactions.product_code) as 'Sales in Chennai' from transactions 
inner join date
on 
transactions.order_date = date.date
where transactions.market_Code='Mark001'
---What is the total quantity sold of each product type in Chennai?---
select transactions.product_Code,sum(transactions.sales_qty) as 'total sales' from transactions
inner join date
on 
transactions.order_date=date.date
where transactions.market_Code='Mark001' and date.year =2017
group by transactions.product_code

